import React from 'react';

const Navbar = () => {
    return (
        <div>
            <nav className='bg-bgDark py-4'>
                <h1 className="text-center text-3xl font-bold text-white">Top Courses</h1>
            </nav>
        </div>
    )
}

export default Navbar
